import React from 'react'

class authComponent extends React.Component {
    render() {
        return (
            <form>
                <label>
                    Username
                </label>
                <input type = "text"/>
                <label>Password</label>
                <input type = "password"/>
                <button type = "password">Login</button>
            </form>
        )
    }
}

export default authComponent
